WITH date_filter AS NOT MATERIALIZED (SELECT d_date_sk FROM date_dim WHERE d_year BETWEEN 1999 AND 1999 + 1), item1_filter AS NOT MATERIALIZED (SELECT i_item_sk FROM item WHERE i_category IN ('Electronics', 'Men')), item2_filter AS NOT MATERIALIZED (SELECT i_item_sk FROM item WHERE i_manager_id BETWEEN 44 AND 63), cd_filter AS NOT MATERIALIZED (SELECT cd_demo_sk FROM customer_demographics WHERE cd_marital_status = 'D' AND cd_education_status = 'College'), sales_base AS NOT MATERIALIZED (SELECT ss_ticket_number, ss_item_sk, ss_customer_sk, ss_list_price, ss_sold_date_sk FROM store_sales WHERE ss_list_price BETWEEN 115 AND 129) SELECT item1.i_item_sk, item2.i_item_sk, COUNT(*) AS cnt FROM sales_base s1 JOIN sales_base s2 ON s1.ss_ticket_number = s2.ss_ticket_number JOIN date_filter d ON s1.ss_sold_date_sk = d.d_date_sk JOIN item1_filter i1 ON s1.ss_item_sk = i1.i_item_sk JOIN item2_filter i2 ON s2.ss_item_sk = i2.i_item_sk JOIN customer c ON s1.ss_customer_sk = c.c_customer_sk JOIN customer_address ca ON c.c_current_addr_sk = ca.ca_address_sk JOIN cd_filter cd ON c.c_current_cdemo_sk = cd.cd_demo_sk WHERE s2.ss_list_price BETWEEN 115 AND 129 AND item1.i_item_sk < item2.i_item_sk GROUP BY item1.i_item_sk, item2.i_item_sk ORDER BY cnt